import logo from './logo.svg';
import './App.css';
import Profile from './components/profile/profile-info/Profile'
import Navigation from './components/navigation/Navigation';
import Posts from './components/profile/posts/Posts'
import {BrowserRouter as Router} from "react-router-dom";

function App() {
  return (
    <div className='container'>
      <div className="left">
        <Router>
         <Switch>
           <Poute exact path="/" component={Profile} />
         </Switch>
       </Router>
       <Navigation/>

      </div>
      <div className= "right">
        <h1>Profile</h1>
        <Profile/>
         <Posts/>
      </div>
    </div>

  );
}

export default App;
